.: Plot :.

GLEE is an uplifting series with biting humor that features a soundtrack of hit music from past to present. The show follows an optimistic high school teacher, WILL SCHUESTER (Matthew Morrison), as he tries to refuel his own passion while reinventing the high school's glee club and challenging a group of outcasts to realize their star potential. It's not an easy task when the pitch-imperfect club includes MERCEDES (Amber Riley), a forceful diva-in-training; ARTY (Kevin McHale), a geeky guitarist; KURT (Chris Colfer), a dramatic soprano; TINA (Jenna Ushkowitz), a punk rocker; and self-proclaimed &quot;star&quot; RACHEL (Lea Michele), a perfectionist firecracker. McKinley's cruel high school caste system prevents the glee club from flourishing, so Will recruits FINN (Cory Monteith), the quarterback with movie star looks, to join the group even though he wants to protect his reputation with his holier-than-thou girlfriend, QUINN (Dianna Agron), and his arrogant teammate, PUCK (Mark Salling). With harsh criticism from everyone, including Will's tough-as-nails wife TERRI (Jessalyn Gilsig) and McKinley's egotistical cheerleading coach SUE SYLVESTER (Jane Lynch), he is determined to prove them all wrong and lead the glee club to the greatest competition of them all: Nationals.

