.: Card :.

Glee is a musical comedy-drama television series that airs on Fox in the United States. It focuses on a high school show choir (a modern glee club) called &quot;New Directions&quot;, at the fictional William McKinley High School in Lima, Ohio. The pilot episode of the show was broadcast after American Idol  on May 19, 2009, and the first season began airing on September 9, 2009. On September 21, 2009, Fox officially gave the series a full-season pick-up. Glee aired its mid-season finale on December 9, 2009 and returned from a four-month hiatus  on April 13, 2010, picking up the remaining nine episodes of the season. The spring premiere had an estimated 13.7 million viewers, nearly doubling in followers on its return. It was renewed for a second season, which is scheduled to begin on September 21, 2010, and will feature three new cast members. On May 23, 2010, it was announced that Glee had been picked up for a third season.

